import PageWrapper from './components/PageWrapper';
import Home from './components/Pages/Home';
import {BrowserRouter as Router, Route, Link} from 'react-router-dom';

class App extends Component {
  render(){
    return (
        <Router>
          <Route 
            exact={true}
            path="/"
            render={props => (
              <PageWrapper>
                <Home {...props} />
              </PageWrapper>
            )}
          />
        </Router>
    );
  }
}

